USE hospital;

CREATE TABLE `pacientes` (
  `nome` VARCHAR(512),
  `idade` BIGINT,
  `cpf` VARCHAR(14),
  `rg` VARCHAR(1024),
  `data_nasc` VARCHAR(12),
  `sexo` VARCHAR(18),
  `signo` VARCHAR(24),
  `mae` VARCHAR(512),
  `pai` VARCHAR(512),
  `email` VARCHAR(512),
  `senha` VARCHAR(512),
  `cep` VARCHAR(10),
  `endereco` VARCHAR(512),
  `numero` BIGINT,
  `bairro` VARCHAR(512),
  `cidade` VARCHAR(512),
  `estado` VARCHAR(48),
  `telefone_fixo` VARCHAR(15),
  `celular` VARCHAR(15),
  `altura` VARCHAR(12),
  `peso` BIGINT,
  `tipo_sanguineo` VARCHAR(8),
  `cor` VARCHAR(8)
);

